import kitty from './petImages/kittysad.jpg';
import React from 'react';
import PetProfile from './PetProfile';
import {
    Heading, 
    Box,
}from 'grommet';

const PetProfiles = () => {
    return (
        <>
        <Heading>
            Search for a fluff
        </Heading>
        <Box>
            <PetProfile image={kitty} name={"Sprinkles"}/>
        </Box>
        </>
    )
};

export default PetProfiles;
